    return (
        <header>
            <a href="#softskills">SoftS<img class="softskills" title="Soft Skills" src="https://cdn-icons-png.flaticon.com/512/3062/3062533.png" /></a>
            <div className="first-div">
                <h1>Guilherme Moret</h1>
                <h3>Full Stack developer</h3>
                <img className="profilepic" src={gui}></img>
            </div>
                <img className="dev" src={dev} alt="Developer Desk"></img>
        </header>
    );
}

export default Header;
